import React from 'react';

function Register(props) {

    return (
    <div class="register-photo" style={{marginTop: '30px',paddingBottom: '5px'}}>
        <div class="form-container">
            <div class="image-holder"></div>
            <form method="post">
                <h2 class="text-center"><strong>Create</strong> an account.</h2>
                <div class="form-group"><input type="email" class="form-control" name="email" placeholder="Email" autofocus /></div>
                <div class="form-group"><input type="text" class="form-control" name="username" placeholder="User Name" autofocus /></div>
                <div class="form-group"><input type="password" class="form-control" name="password" placeholder="Password" autofocus /></div>
                <div class="form-group"><input type="password" class="form-control" name="password-repeat" placeholder="Confirm Password" autofocus /></div>
                <div class="form-group"><button class="btn btn-primary btn-block" type="submit">Sign Up</button></div><a class="already" href="#">You already have an account? Login here.</a></form>
        </div>
    </div>
    );

}

export default Register;
